  [],\n\t\"title\": \"Index Layers for High-Resolution Orthorectified Imagery from
  Approximately 1980 for the Coastal Areas of Bering Land Bridge NP (BELA) and Cape
  Krusenstern NM (CAKR), Northwest Alaska\",\n\t\"tracking_summary\": {\n\t\t\"total\":
