  [],\n\t\"revision_timestamp\": \"2013-03-15T10:54:43.046242\",\n\t\"name\": \"index-layers-for-high-resolution-orthorectified-imagery-from-approximately-1980-for-the-coastal9dc21\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This vector shapefile is one of two index
  map layers for 57 frames of orthorectified aerial photography from approximately
  1980 for the coastal and nearshore areas of Bering Land Bridge National Preserve
  (BELA), Cape Krusenstern National Monument (CAKR), and nearby portions of northwestern
  Alaska. The index polygons are attributed with image filename, photo date, RMSE,
  scale, frame and roll numbers. The frames are derived from 1:64,000-scale, color-infrared
  (CIR) photographs acquired by the USGS from 1978 to 1985, as part of the Alaska
  High Altitude Photography (AHAP) program. Other imagery available in this series
  includes orthorectified aerial photography for approximately 1950 and 2003. All
  data is available through an unrestricted public license, and can be obtained on
  a hard drive by request (see Distributor contact information below). The imagery
  will be of interest to land managers, scientists, and others for observation and
  analysis of natural features and ecosystems.\",\n\t\"license_title\": null,\n\t\"extras\":
